import React from "react";
import { NavLink } from "react-router-dom";

const HeaderNav = () => {
  return (
    <ul className="main-nav">
      <li>
        {" "}
        <NavLink exact to="/?page=1">
          {" "}
          0-24{" "}
        </NavLink>
      </li>
      <li>
        {" "}
        <NavLink to="/?page=2"> 25 to 50 </NavLink>
      </li>
      <li>
        {" "}
        <NavLink to="/?page=3"> 50 to 75 </NavLink>
      </li>
      <li>
        {" "}
        <NavLink to="/?page=4"> 75 to 100 </NavLink>
      </li>
    </ul>
  );
};

export default HeaderNav;
